script: |
  super -f text -I q7283.spq | sort > q7283.out

inputs:
  - name: q7283.spq
    data: |
      SELECT DISTINCT + col2 AS col0 FROM tab1 (FORMAT parquet) WHERE + 59 * - - col0 NOT IN ( + + 52 + + 95 ) OR 84 IS NOT NULL;
  - name: tab1

outputs:
  - name: q7283.out
    data: |
      59
      68
      96
